import React from "react";
import { data } from "../helper/data";

const CardContainer = () => {
  return (
    <div>
      <div>
        <input type="text" name="" id="" placeholder="Search Player..." />
      </div>
     <div>
     {data.map((player)=> {{data.map((player) => (
        <div className="card">
          <img src={player.img} alt="player-img" />
          <h3>{player.name}</h3>
          <ul>
            {player.statistics.map((statistic) => (
              <li>{statistic}</li>
            ))}
          </ul>
        </div>
      ))}})}</div>
    </div>
  );
};

export default CardContainer;
